import React from 'react'
import Footer from '../../Components/Footer'
import Header from '../../Components/Header'
import triangles from '../../Files/Triangles.svg'

const head = "RICE UNIVERSITY";
const first_blurb = 'Creating a community of mentors and friends and partner with companies to provide the best resources for students to explore computer science and software';

function HomePage() {
    return (
    <div className="relative">
      <div className="flex text-gray-500 text-6xl font-semibold mt-24 ml-32 justify-start">{head}</div>
      <div className="flex text-gray-500 text-6xl font-semibold ml-32 justify-start">CS CLUB</div>
      <p className="flex justify-start ml-32">{first_blurb}</p>
      <img class="absolute object-left" width="150px" height="150px" src={triangles}/>   
      <Footer/>
    </div>

    );
  }

export default HomePage
